export default {
    state: {
        issues: mockIssues, // Array of issues
        repos: [],          // Array of issues grouped by repository
        velocity: [],       // Array of repos with velocity data
        query: '*',         // ES query string
        loading: false,     // Loading flag
    },
    reducers: {
        setIssues(state, payload) {return { ...state, issues: payload };},
        setQuery(state, payload) {return { ...state, query: payload };},
        setRepos(state, payload) {return { ...state, repos: JSON.parse(JSON.stringify(payload)) };},
        setVelocity(state, payload) {return { ...state, velocity: JSON.parse(JSON.stringify(payload)) };},
        setLoading(state, payload) {return { ...state, loading: payload };},
    },
    effects: {
        async initIssues(payload, rootState) {
            this.setLoading(true);
            const issues = rootState.data.issues;

            const repos = getRepoNames(issues).map((repo) => {
                return issues.filter(issue => issue.repo.name === repo)
            });

            this.setRepos(repos);
            this.refreshVelocity();
        },

        async refreshVelocity(payload, rootState) {
            const t0 = performance.now();

            console.log(refreshVelocity(rootState.data.repos[0]));

            let velocity = [];
            await rootState.data.repos.forEach((repo) => {
                velocity.push({...refreshVelocity(repo), title: repo[0].repo.name});
            });
            this.setVelocity(velocity);

            const t1 = performance.now();
            console.log("refreshVelocity - took " + (t1 - t0) + " milliseconds.");
            this.setLoading(false);
        },

    }
};
